import React from 'react';
import { Link } from 'react-router-dom'

const SideCollabos = ({ collabortors }) => {
  const collaboratorLinks = collabortors.map ( collabortor => (
    <Link key={collabortor.id} to={`/collabortors/${collabortor.id}`}>{collabortor.name}</Link>
  ))
  return(
    <div className="SideBar">
    <h4>Collaborator List </h4>
      {collaboratorLinks}
    </div>
  )
}


export default SideCollabos
